import java.util.*;
import java.io.*;

class  Main {
    public static void main(String[] args) throws Exception {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        int max = sc.nextInt();
        int[] arr = new int[n];
        for (int i = 0; i < n; i++) {
            arr[i] = sc.nextInt();
        }
        Arrays.sort(arr);
        int expense = -1;
        int diff = -1;
        int l = 0;
        int r = n - 1;
        while (r - l >= 1) {
            int sum = arr[l] + arr[r];
            if (sum <= max) {
                if (sum >= expense) {
                    expense = sum;
                    diff = arr[r] - arr[l];
                }
                l++;
            } else {
                r--;
            }
        }
        System.out.println(expense + " " + diff);
    }

    static StringBuilder sb = new StringBuilder();
}
